import React from 'react'
import { useParams } from 'react-router-dom';
// import { useState, useEffect } from 'react';
// import CompanyFinder from '../../apis/CompanyFinder';



const Navbar = () => {

  const {id } = useParams();
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <a className="navbar-brand" href="#" style={{ color: '#ff6347' }}>Profile</a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo02" aria-controls="navbarTogglerDemo02" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>

      <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
        <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
          <li className="nav-item active">
            <a className="nav-link" href="http://localhost:3000/Employer//jobs" style={{ color: '#00bfff' }}>Jobs <span className="sr-only">(current)</span></a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="http://localhost:3000/Employer/1/employees" style={{ color: '#20b2aa' }}>Employees</a>
          </li>
          <li className="nav-item">
            <a className="nav-link disabled" href="#" tabIndex="-1" aria-disabled="true" style={{ color: '#4682b4' }}>Applications</a>
          </li>
        </ul>
        <form className="form-inline my-2 my-lg-0">
          <input className="form-control mr-sm-2" type="search" placeholder="Search"/>
          <button className="btn btn-outline-success my-2 my-sm-0" type="submit" style={{ color: '#fff', backgroundColor: '#ff6347', borderColor: '#ff6347' }}>Search</button>
        </form>
      </div>
    </nav>
  )
}

export default Navbar
